// https://j1sonplaceholder.typicode.com/posts?q=

import {fromEvent, map} from "rxjs";

const search = document.getElementById('search');

fromEvent(search,"keyup")
        .pipe(
                map(event=>event.target.value)
        )
        .subscribe(console.log)
